import './App.css';
import Home from './Views/Home';
import { BrowserRouter as Router, Route } from 'react-router-dom';
function App() {
  return (
    <div className="App">

      <Router>
        <Route path='/videogames' element={<Home />} />
        <Route path='/' element={<Landing />} />
      </Router>
    </div>
  );
}

export default App;
